INSERT INTO `libros` VALUES (1,'El resplandor','Stephen King','The Shining mainly takes place in the fictional Overlook Hotel, an isolated, haunted resort hotel located in the Colorado Rockies. The history of the hotel, which is described in backstory by several characters, includes the deaths of some of its guests and of former winter caretaker Delbert Grady, who succumbed to cabin fever and killed his family and himself.','data:image/jpeg;base64,','Doubleday'),(2,'Rayuela','Julio Cortazar','El amor turbulento de Oliveira y La Maga, los amigos del Club de la Serpiente, las caminatas por Paría en busca del cielo y el infierno tienen su reverso en la aventura simétrica de Oliveira, Talira y Traveler en un Buenos Aires teñido por el recuerdo.','data:image/jpeg;base64,','Sudamericana'),(5,'Los juegos del Hambre','Suzanne Collins','The Hunger Games is a series of young adult dystopian novels written by American author Suzanne Collins. The first three novels are part of a trilogy following teenage protagonist Katniss Everdeen, and the fourth book is a prequel set 64 years before the original.','data:image/jpeg;base64,','Scholastic Press'),(6,'Crónica de una muerte anunciada','Gabriel García Márquez','En un pequeño y aislado pueblo en la costa del Caribe, se casan Bayardo San Román, un hombre rico y recién llegado, y Ángela Vicario. Al celebrar su boda, los recién casados se van a su nueva casa, y allí Bayardo descubre que su esposa no es virgen. Inmediatamente, Bayardo devuelve a Ángela Vicario a la casa de sus padres donde es golpeada por su madre e interrogada por sus hermanos, Ángela culpará a Santiago Nasar, un vecino del pueblo.','data:image/jpeg;base64,','La Oveja Negra'),(11,'El nombre del viento','Patrick Rothfuss','He robado princesas a reyes agónicos. Incendié la ciudad de Trebon. He pasado la noche con Felurian y he despertado vivo y cuerdo. Me expulsaron de la Universidad a una edad a la que a la mayoría todavía no los dejan entrar. He recorrido de noche caminos de los que otros no se atreven a hablar ni siquiera de día. He hablado con dioses, he amado a mujeres y he escrito canciones que hacen llorar a los bardos. Me llamo Kvothe. Quizá hayas oído hablar de mí.','data:image/jpeg;base64,','DAW Books');
